#include <stdio.h>


int memo[46];

int climbStairs_recursive(int n) {
    if (n <= 2) {
        return n; 
    }

    if (memo[n] != 0) {
        return memo[n];
    }

       memo[n] = climbStairs_recursive(n - 1) + climbStairs_recursive(n - 2);

    return memo[n];
}


int climbStairs(int n) {

    for (int i = 0; i <= n; i++) {
        memo[i] = 0;
    }
    return climbStairs_recursive(n);
}

